import React from 'react';
import Nav from 'react-bootstrap/Nav';

function Tab() {
  return (
    <Nav
      defaultActiveKey="/home"
      className="flex-column"
      style={{
        position: 'sticky',
        marginTop: '9%',
        display: 'inline-block',
        heigh: '100%',
      }}
    >
      <Nav.Link
        style={{
          color: 'rgb(60,125,128)',
        }}
        href="/home"
      >
        Home
      </Nav.Link>
      <Nav.Link eventKey="link-1">Sleeping tips</Nav.Link>
      <Nav.Link eventKey="link-2">Playing tips</Nav.Link>
      <Nav.Link eventKey="link-3">Find playground</Nav.Link>
      <Nav.Link eventKey="link-4">Find restaurant with kidsroom</Nav.Link>
    </Nav>
  );
}

export default Tab;
